import React from 'react';
import { Route, Routes } from 'react-router-dom';
import CustomLink from './CustomLink';
import './Unit.css';

function Unit({ unit }){
    const topics = [
        ['Types of Variables', 'Converting Categorical Data into Numeric Data'],
        ['K-Means', 'Principal Component Analysis (PCA)']
    ];
    let subUnitList;
    if(unit - 1 < topics.length){
        subUnitList = topics[unit - 1].map(title => <li><CustomLink to={`\${title}`} className='subunit'>{title}</CustomLink></li>);
    }
    return (
        <div className={`unit${unit}`}>
            <h2>Unit {unit}</h2>

            <ul>{subUnitList}</ul>
            <Routes>
                {topics[unit - 1].map(title => <Route path={`\${title}`} elementt={<Home />}></Route>)}
                <Route path="/" element={<Home />} />
                <Route path="/home" element={<Home />} />
                <Route path="/about" element={<About />} />
                <Route path="/unit1" element={<Unit unit={1} />} />
                <Route path="/unit2" element={<Unit unit={2} />} />
                <Route path="/unit3" element={<Unit unit={3} />} />
                <Route path="/unit4" element={<Unit unit={4} />} />
            </Routes>
        </div>
    );
};
export default Unit;
